import './App.css';
import ConnexionInscription from "./component/ConnexionInscription/ConnexionInscription";
import Navbar from "./component/Navbar/Navbar";
import {useState} from "react";
import UserList from "./component/UserList/UserList";


function App() {
    //state
    const [isConnected, setIsConnected] =  useState(true);
    const [isAdmin, setIsAdmin] =  useState(true);


    // Utilisation d'un objet de mappage
    const componentMapping = {
        // home: <Home />,
        UserList: <UserList />,
        ConnexionInscription: <ConnexionInscription />,

    };

    const renderComponent = (componentName) => {
        return componentMapping[componentName] || componentMapping.default;
    };

// Utilisation dans un composant
    const MyComponent = ({ componentName }) => {
        return (
            <div>
                {renderComponent(componentName)}
            </div>
        );
    };


    //comportement

    //render
    return (
        <div>
        <Navbar isConnected ={isConnected} isAdmin={isAdmin}  />
        {/*
        <ConnexionInscription isConnected ={isConnected} setIsConnected={setIsConnected} isAdmin={isAdmin} setIsAdmin={setIsAdmin}/>
        */}
        <UserList></UserList>


        </div>
    );
}





export default App;
